import React, { useState } from "react";
import NavBar from "./Navbar";

function AdminSignup() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [userstatus, setUserStatus] = useState(1); // Default to 1 for teacher

  const handleSubmit = async (e) => {
    e.preventDefault();

    let params = {
      username: username,
      email: email,
      password: password,
      userstatus: userstatus,
    };

    try {
      const response = await fetch('http://localhost:4001/register', {
        method: 'post',
        headers: {
          Accept: 'application/json',
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(params),
      });

      const result = await response.json();

      if (response.ok) {
        console.log(result);
        // Handle success, show a success message or redirect to login page
      } else {
        // Handle signup failure, show an error message, etc.
        console.error(result.error);
      }
    } catch (error) {
      console.error("Error during signup:", error);
    }
  };

  return (
    <>
      <NavBar />
      <div className="container-fluid">
        <div className="row h-100 align-items-center justify-content-center" style={{ minHeight: '100vh' }}>
          <div className="col-12 col-sm-8 col-md-6 col-lg-5 col-xl-4">
            <div className="bg-light rounded p-4 p-sm-5 my-4 mx-3">
              <div className="d-flex align-items-center justify-content-between mb-3">
                <a href="index.html" className="">
                  <h3 className="text-primary"><i className="fa fa-hashtag me-2"></i>Admin</h3>
                </a>
                <h3>Sign Up</h3>
              </div>
              <form action="" method="post" onSubmit={handleSubmit}>
                <div className="form-floating mb-3">
                  <input type="text" name="username" className="form-control" onChange={(e) => setUsername(e.target.value)} id="floatingText" placeholder="jhondoe" />
                  <label htmlFor="floatingText">Username</label>
                </div>
                <div className="form-floating mb-3">
                  <input type="email" name="email" className="form-control" onChange={(e) => setEmail(e.target.value)} id="floatingInput" placeholder="name@example.com" />
                  <label htmlFor="floatingInput">Email address</label>
                </div>
                <div className="form-floating mb-4">
                  <input type="password" name="password" className="form-control" onChange={(e) => setPassword(e.target.value)} id="floatingPassword" placeholder="Password" />
                  <label htmlFor="floatingPassword">Password</label>
                </div>
                <div className="form-check mb-4">
                  <input type="radio" name="userstatus" value="1" checked={userstatus === 1} onChange={() => setUserStatus(1)} className="form-check-input" id="teacherRadio" />
                  <label className="form-check-label" htmlFor="teacherRadio">Teacher</label>
                  <input type="radio" name="userstatus" value="2" checked={userstatus === 2} onChange={() => setUserStatus(2)} className="form-check-input" id="studentRadio" />
                  <label className="form-check-label" htmlFor="studentRadio">Student</label>
                </div>
                <button type="submit" className="btn btn-primary py-3 w-100 mb-4">Sign Up</button>
                <p className="text-center mb-0">Already have an Account? <a href="/adminlogin">Sign In</a></p>
              </form>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default AdminSignup;
